import React, { Component } from 'react'

class RightBar extends Component {
  render() {
    return (
      <div className="rightBar">
        <h2>Compress</h2>
        <span className="file__name">{this.props.nameFile}</span> <br />
        <span>{this.props.size}</span>
      </div>
    )
  }
}

export default RightBar
